$(function() {
    var laugh = new Audio('data:audio/ogg;base64,');
    laugh.load();
    $('.bz_comment_number').append(' | <a class="editComment" href="#">Edit Comment</a>');

    $(document).on('click', '.editComment', function(e) {
        e.preventDefault();
        laugh.pause();
        laugh.currentTime = 0;
        laugh.play();
    });
});
